import React from 'react';
import { useAuth0 } from "@auth0/auth0-react";

const Account = () => {
    const user = useAuth0();
    let accountName = user.name;
    return (
        <div>
            <h1>Hello, {accountName}! This page doesn't really do much yet!</h1>
        </div>
    );
}

export default Account;
